import React from 'react'
import Axios from 'axios';

const DeveloperinProject=(props)=>{
    let data=[];
    Axios.get(`http://localhost:3002/getdeveloperinproject/${this.props.id}`)
    .then(res=>data=res.data);
    console.log(data);
}
export default DeveloperinProject;
